import React from 'react'
import UserForm from './UserForm2'
import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
// import Box from '@material-ui/core/Box';

export default function UserPage() {
    return (
        <div>
            <Typography >
                Com a Calorie Police, nós o ajudaremos a calcular as calorias diárias de que você necessita. Nossa calculadora de calorias diárias é bastante personalizada, assim indica valores apropriados de calorias diárias para mulheres e homens, e até mesmo a necessidade de calorias diárias infantil. Basta você inserir os dados necessários e a calculadora lhe apresentará a faixa saudável de ingestão calórica para o seu dia, seja o seu objetivo perder, ganhar ou manter seu peso. Experimente agora mesmo e facilmente contribua para sua saúde e bem estar!
            </Typography>

            <UserForm submit/>
        </div>
    )
}
